import './middleCard.css';
import sa from './sa.jpg'

export function MiddleCard ({sda}){
    return(
        <section className="middleCard__section">
            <img src={sa} alt="картинка" className="middleCard__img"/>
            <aside className='middleCard__text'>
                <p className="middleCard__name">Герой наших снов</p>
                <p className="middleCard__rental">7 марта - 3 апреля</p>
            </aside>
        </section>
    )
}
